INSERT INTO comments(restaurant_id, author, text, stars, date) VALUES
(1994,E'Даниил Андреев',E'Все идеально! Буду заказывать ещё :) (P.S. узнал о вас от МЯЧ Production)',5,E'2022-04-29T20:41:33+0300'),
(1994,E'Надежда',E'Отлично, спасибо!!!!',4,E'2022-04-29T20:28:42+0300'),
(1994,E'Софья',E'Было вкусно, но сделано ужасно, разваливаются, криво.',2,E'2022-04-29T20:08:45+0300'),
(1994,E'Гуля',E'Спасибо вам за быструю доставку,  еда была очень вкусной👍🏼👍🏼👍🏼👍🏼👍🏼',4,E'2022-04-29T03:16:50+0300'),
(1994,E'Юлия',E'Пиццу привезли вовремя, но вкус пиццы…\nОчень пресная, почти нет специй, как будто вообще не добавляли соли. Просто ели свежие кусочки помидора. Сыра практически нет. За такую цену ждали другого наполнения. К сожалению…оценка 3…хотя привезли вовремя, собран заказ верно, и пицца была горячей.',3,E'2022-04-28T23:44:05+0300'),
(1994,E'Артемий',E'курьеру большой рахмет, все ништяк',5,E'2022-04-28T23:11:54+0300'),
(1994,E'Полина',E'Ожидания оправдала только пицца (хотя цена превышена), а остальное – простенькое и стоит явно меньше. Если судить качество, то оно возможно и хорошее, но после съедения всё равно как-то мутит... Думаю полная 4 у этого заведения есть, но не выше, да и цены немного кусаются.',1,E'2022-04-28T18:18:27+0300'),
(1994,E'Юлия',E'Все вкусно, принести очень быстро\nВсем довольны',5,E'2022-04-28T17:35:36+0300'),
(1994,E'Гасан',E'васаби совсем никакой . однако сами роллы вкусные !!',2,E'2022-04-28T16:37:20+0300'),
(1994,E'Николай',E'Забыли салфетки положить',3,E'2022-04-28T12:58:43+0300'),
(1994,E'Дарья',E'Заказывала вок с баклажанами в остром соусе и ролл Филадельфию. Доставили вовремя. Все свежее, собрано и упаковано каждое блюдо в отдельный пакет, к каждому блюду положили приборы. Очень все вкусно! Заказывала первый раз, очень довольна.',5,E'2022-04-28T12:51:06+0300'),
(1994,E'Дмитрий',E'Роллы разваливались. Кушать их было неприятно. Плюс заказ доставлен был с 15 минутным опозданием. Никто заранее не предупредил.',3,E'2022-04-28T12:14:37+0300'),
(1994,E'Мирлан',E'не кому не советую заказывать в етом ресторане не какого вкуса не еда не сервис',3,E'2022-04-28T01:42:05+0300'),
(1994,E'Анастасия',E'Вкусно, жаль палочки не положили, а только вилки',4,E'2022-04-27T22:37:13+0300'),
(1994,E'Дарья',E'Аккуратно собранные суши, привозят быстро, картошка фри детям показалось солновата. Но в целом нравится, заказываю регулярно тут.',5,E'2022-04-27T21:41:08+0300'),
(1994,E'Валерия Шапкина',E'ужасные роллы. сыра мало, выглядят плохо, цена высокая. на 1000р получили 3 крошки и испорченное настроение',1,E'2022-04-27T18:21:57+0300'),
(1994,E'Артём',E'Отрава и несварение.',3,E'2022-04-27T14:10:22+0300'),
(1994,E'Марина',E'задержали на 1 час доставку, причём она платная',2,E'2022-04-27T12:29:37+0300'),
(1994,E'Елизавета',E'Потрясающая сырная пицца и вкусные роллы, что еще нужно для счастья🌞',5,E'2022-04-27T10:46:55+0300'),
(16302,E'Варвара Фокина',E'Вкусные и горячие блюда, спасибо поворам и курьеру. Мой любимый ресторан, когда хочется приятно провести вечер и хорошо покушать, заказываю здесь!',5,E'2022-04-29T22:01:24+0300'),
(16302,E'Инна',E'Все очень вкусно 😇😊',4,E'2022-04-29T20:39:49+0300'),
(16302,E'Ирина',E'Спасибо',4,E'2022-04-29T19:00:39+0300'),
(16302,E'Екатери Вторая',E'Ролы невкусные',4,E'2022-04-29T18:19:15+0300'),
(16302,E'Мой повелитель',E'Мало сыра на пицце',1,E'2022-04-29T14:36:35+0300'),
(16302,E'Милена',E'Все вкусно',4,E'2022-04-29T13:37:26+0300'),
(16302,E'Никита',E'Очень быстро доставили, спасибо!',5,E'2022-04-29T02:42:33+0300'),
(16302,E'Эмилия',E'Очень вкусно! Заказывали ночью. Привезли вовремя, вежливый сотрудник доставки. Спасибо!',5,E'2022-04-29T02:26:41+0300'),
(16302,E'Алина',E'Более невкусного вока мы не пробовали( Видимо, политика заведения «анти соль и специи» потрму что буквально все пресное. У вока нет совершенно никакого вкуса, как будто просто отварные макарошки, даже соус не спасает. А курицы и новядины как кот наплакал😂 идем далее, пирог - также пресный, как будто ешь просто тесто, пришлось отправить его в мусорку( Крылышки, которые должны были быть острыми, отнадайте что? Тоже пресные)) \n\nЕдинственное, что вкусно- это десерт. На уливление , он сладкий',3,E'2022-04-29T02:24:13+0300'),
(16302,E'Александр',E'было конечно вкусно, но мидии приехали все перевёрнутый и в кашу перемешанные',3,E'2022-04-28T19:30:36+0300'),
(16302,E'Анна',E'Очень вкусная и горячая',3,E'2022-04-28T16:07:47+0300'),
(16302,E'Яна',E'Ролл с креветкой в темпуре был без темпуры. Разваливаются. Имбирь и васаби не положили.',1,E'2022-04-28T15:24:53+0300'),
(16302,E'Яна',E'Вкусно, но к набору с полами не кладут васаби. Почему? И это не указано нигде. ;(',5,E'2022-04-28T14:49:08+0300'),
(16302,E'Даша',E'всë очень вкусненько) заказываю тут часто. решила попробовать супчик - удивилась. запаха рыбы нет, свежий, горячий суп, ингредиентов очень хорошо положили. спасибо большое!',4,E'2022-04-28T12:12:24+0300'),
(16302,E'Дмитрий',E'К Роллам не положили имбирь и васаби, мелочь но не приятно (',2,E'2022-04-28T00:26:08+0300'),
(16302,E'Вероника',E'не положили ни одного имбиря, но привезли приборов и соусов на три персоны (хотя указала 2). где имбирь…??((',1,E'2022-04-27T21:41:52+0300'),
(16302,E'Наталья',E'Все было вкусно, но не положили имбирь вообще!',3,E'2022-04-27T21:20:55+0300'),
(62893,E'Женя',E'нет,невкусно,и очень долго.',2,E'2022-04-24T09:51:26+0300'),
(62893,E'Александр',E'Суши были очень вкусные, пицца тоже.',4,E'2022-04-22T03:46:42+0300'),
(62893,E'Андрей Куча',E'Было невкусно. В Калифорнии с лососем используется, видимо, теша - на редкость противно и неуместно в роллах. Плюс неспелое, но уже испорченное авокадо, хрустящее, как морковь. В Филадельфии от лосося - легкая паволока, чтоб для вида обернуть тонким, как бумажка, кусочком. Краб в Филадельфии оказался, конечно, крабовой палочкой. Острые Унаги Эби - не острые вовсе, но, скорее, сладкие. Заявленные 8 штук роллов в порции - пыль в глаза: тот же объем, что в других заведениях принято резать на 6 частей, разрезали на 8 - эдак скорняк шьет 10 шапок из одной овчики. В целом впечатление от кухни отвратительное.',2,E'2022-04-21T00:42:40+0300'),
(62893,E'Илья',E'Какая-то беда, именно с ролами, которые с угрём, мини ролы с угрём или к примеру острые спайси унаги, кости попадаются.',3,E'2022-04-13T23:01:20+0300'),
(55134,E'Анастасия',E'отвратительно! в коробках гунканы помялись. роллы фууууу. есть их не стали, выкинули. больше не закажем',3,E'2021-08-07T18:41:33+0300'),
(55134,E'Максим',E'мега ролл с лососем 592р лосось не первой свежести, 2 рола из 8 собраны из нескольких кусочков лосося, отправили в ведро. В соевом соусе оказался листочек имбиря, сам соус через 5мин. расслоился с водой, пришлось вылить.Такое вижу впервые за 15 лет. Очень разочарован, не советую, цены не соответствуют качеству.',1,E'2021-07-11T01:36:19+0300'),
(55134,E'Мария',E'Откровенно невкусно.Роллы с крабом пахли несвежестью,рис невкусный,соевый соус разбавленный.Заказывала первый раз и надеялась что все будет отлично,но нет.Если делаете-делайте качественно,ребята,а так-лучше вообще не делать.Разочарование и выброшенные деньги.',3,E'2021-06-30T09:24:56+0300'),
(55134,E'Павел С.',E'Заказываем третий раз и всегда все чётко. Самые вкусные роллы в районе, на мой взгляд.\nДержите планку и дальше! Спасибо!',5,E'2021-05-09T13:51:10+0300'),
(55134,E'Кристина',E'Сделали заказ, чтобы попробовать новый ресторан и были неожиданно приятно удивлены. Продукты свежие, порции большие, цены приемлемые. \nНаша семья однозначно рекомендует всем попробовать! \nНадеемся, со временем не испортитесь как остальные\n5 баллов',4,E'2021-05-08T14:06:05+0300'),
(55134,E'Ольга',E'Очень мало соевого соуса, васаби и имбиря на это колличество роллов.',1,E'2021-04-02T20:15:42+0300'),
(55134,E'Надежда Соболева',E'В сете трио попадались косточки((',1,E'2021-03-28T14:15:36+0300'),
(55134,E'Анастасия',E'Все как и всегда на высшем уровне, вкусное, свежее 😍🤗',5,E'2021-03-19T18:16:01+0300'),
(55134,E'Анастасия',E'Всё просто великолепно и очень вкусно!😍😊',4,E'2021-03-12T02:18:12+0300'),
(55134,E'Александр',E'Очень вкусные роллы, даже те, которые были за баллы и бесплатные - отличные! Доставили вовремя. Очень довольны заказом, добавили в "любимые места") Ресторан рекомендуем.',4,E'2021-03-08T18:31:46+0300'),
(55134,E'Юлия ',E'отличный ресторан. все очень понравилось. вкусная , свежая еда.',4,E'2021-03-08T16:29:22+0300'),
(55134,E'Анастасия',E'Ужасно не вкусно, холодные,это просто есть не возможно. Последний раз я заказывала .',1,E'2021-03-08T12:36:40+0300'),
(55134,E'Таня',E'Не положили соусники и салфетки',1,E'2021-03-06T23:11:07+0300'),
(55134,E'Виктория',E'суши пришли холодные и как каша',1,E'2021-02-28T13:01:32+0300'),
(55134,E'дмитрий базатин',E'все отлично. роллы как всегда на высоте - очень вкусно.',4,E'2021-02-25T12:30:28+0300'),
(55134,E'Анастасия',E'все супер, но не положили подарочный сет',5,E'2021-02-14T19:33:39+0300'),
(55134,E'Тамара',E'Скажу честно - это чисто сетевые роллы, но просто более аккуратные. Шапки из майонеза вперемешку с крабовыми палками напоминают обычный суши вок. По-вкусу отвращения не было, но сказать что поехала в охотку тоже нет. \n6 из 10',4,E'2021-02-07T11:07:29+0300'),
(55134,E'Варвара',E'очень вкусные суши, вычищенные креветки, привезли быстро, роллы теплые, вежливый курьер',5,E'2021-01-16T23:54:00+0300'),
(56566,E'Владимир',E'Всё очень вкусно! Спасибо)',4,E'2022-03-29T15:40:08+0300'),
(56566,E'Роман Чудинов',E'Все очень вкусно',5,E'2022-03-13T13:01:43+0300'),
(56566,E'Ирина',E'Очень вкусные роллы! Любим приходить в это кафе, а теперь еще можно и бесплатно заказывать домой, спасибо!',4,E'2022-02-05T08:27:54+0300'),
(56566,E'Екатерина',E'Несвежие продукты, все в мусор.',2,E'2021-10-16T23:43:12+0300'),
(56566,E'Алексей',E'Потрясающее качество блюд. Ризотто и говядина средней обжарки сделала наш вечер!',5,E'2021-05-09T20:50:21+0300'),
(35180,E'Marina',E'как всегда все очень вкусно, точно в указанное время! спасибо большое!',4,E'2022-04-29T18:33:02+0300'),
(60644,E'Елена Дежурова',E'Ожидали Том ям с креветками.  Получили горьковатый бульон с одной креветкой в смятых одноразовая тарелках! Не рекомендую!',3,E'2021-12-15T20:47:33+0300'),
(60644,E'Вячеслав',E'Раз на раз не приходится,как повезёт и как приготовят\nПицца холодная,так же в пицце нашёл два волоса',3,E'2021-08-05T15:22:10+0300'),
(60644,E'Одил',E'не вкусно все это не пицца а ерунда.',1,E'2021-03-19T16:19:04+0300'),
(86356,E'Мария',E'Итак, заказала суп и роллы с угрем (стоимость роллов 630 рублей))) \nСуп кислый - есть невозможно, в роллы угорь не положили 👌🏻\nПозвонила в данное заведение: как решение проблемы мне предложили ещё еды там заказать со скидкой в 30% 🤦🏻\u200d♀️ после моего возмущения на данное предложение и просьбы заменить еду, согласились и попросили ждать звонка, мне перезвонили через 34 минуты, и сказали, что курьер может выехать с новыми роллами)) \n\nЕсли хотите остаться голодными и испортить настроение- отрешайтесь к этим ребятам)',1,E'2022-04-26T01:59:52+0300'),
(86356,E'Юлия',E'Меню достаточно большое, с красивыми и вкусными на вид фотографиями. Заказала для пробы. Редко бывает, так что фото соответствует реальности. Доставили достаточно быстро, все было горячее. Все блюда соответствуют фотографиям на сайте. Бургер сочный и соус превосходный.',5,E'2022-04-24T03:16:21+0300'),
(86356,E'Валентин Брыков',E'Спасибо за доставку. Блюда все ещё горячие, еда вкусная. Доставили быстро и без проблем. Будем заказывать только у вас!',4,E'2022-04-24T02:42:58+0300'),
(86356,E'Екатерина',E'Тортики свежие, вкусные, превзошли ожидания. Спасибо',4,E'2022-04-05T12:12:38+0300'),
(86356,E'Анна',E'Говядина в бургере была немного жестковата и лучше под брускетту подкладывать какую-нибудь крафт бумагу, а то сыворотка от страчателлы вытекла и пролилась на дно из-за чего хлеб пропитался и размяк. В целом по вкусу неплохо, порции нормальные.',4,E'2022-04-03T18:06:25+0300'),
(86356,E'Михаил',E'Все было свежее и очень вкусное! Порции как на картинке, ребята прям стараются) спасибо!',4,E'2022-04-03T04:10:13+0300'),
(86356,E'Наиль',E'Вместе с отличным , горячим бефстроганов приехал ледяной бургер . Очевидно что курица для бургера была приготовлена заранее а после собран бургер , следовательно она «полежавшая» . Полежавший чикенбургер за 550 рублей это странно , в остальном всё отлично . 6/10',1,E'2022-03-29T14:35:56+0300'),
(86356,E'Анна',E'Приятно удивила скорость доставки:вместе 1,5 часов привезли за 35 минут. Все свежее,горячее,расфасовано в отдельные боксы. Блюда вкусные,видно что «из под ножа». Все понравилось,буду заказывать ещё. Спасибо Вам!',4,E'2022-03-14T15:53:09+0300'),
(2305,E'ирина',E'очень вкусно, красиво - брендирование упаковки топ, но дорого и долго доставляют',5,E'2022-04-30T00:49:24+0300'),
(2305,E'Павел
