(33619,4,E'Салат цезарь с креветками',590,E'Морская версия. Сочные креветки вперемешку со свежими овощами, сухариками и перепелиными яйцами. Состав: креветки, масло подсолнечное, соль, перец черный молотый, салат айсберг, соус цезарь, гренки, сыр пармезан, помидоры, яйцо перепелиное. Кбжу 440/21/36. 184 ккал/100 г',240,184,E'344095284.jpeg'),
(33619,5,E'Сэндвич роллы с тунцом и с лососем',590,E'Состав: рис, филе лосося, филе тунца, сыр сливочный, соус спайси, огурец, мука темпурная, сухари панко, масло фритюрное, соус унаги, икра тобико черная, икра тобико оранжевая, лук зеленый, водоросли нори, кунжут белый жареный. Кбжу 810/28/48/67. 311 ккал/100 г',260,311,E'344132998.jpeg'),
(33619,5,E'Два сэндвич ролла с лососем',590,E'Состав: рис, филе лосося, сыр сливочный, соус спайси, огурец, мука темпурная, сухари панко, масло фритюрное, соус унаги, икра тобико оранжевая, лук зеленый, водоросли нори, кунжут белый жареный. Кбжу 830/27/50/68. 317 ккал/100 г',260,317,E'344095264.jpeg'),
(33619,5,E'Наггетсы куриные с картофелем фри (6 шт,)',320,E'Золотая курочка. Обжаренные во фритюре ломтики курицы и картошки с соусом из сливочного сыра с майонезом, зеленью и чесноком. Все готово, осталось придумать напиток. Состав: наггетсы куриные, панировка, картофель фри, соль, масло фритюрное, соус фирменный. 180 ккал/100 г',220,180,E'341606212.jpeg'),
(33619,5,E'Наггетсы куриные с картофелем фри (12 шт,)',570,E'Золотая курочка — порция на двоих. Обжаренные во фритюре ломтики курицы с картошкой. И нежный соус, которого хватит на всех. Состав: наггетсы куриные, панировка, картофель фри, соль, масло фритюрное, соус фирменный (сыр сливочный, майонез, петрушка, соль. 180 ккал/100 г',440,180,E'341606236.jpeg'),
(33619,5,E'Картофель фри',190,E'Гарнир ко всему. Жареные ломтики картошки и нежный соус. Если есть руками, точно пальчики оближешь! состав: картофель фри, масло подсолнечное для фритюра, соль, соус фирменный (сыр сливочный, майонез, петрушка, соль, чеснок). Кбжу 240/4/12/28. 121 ккал/100 г',195,121,E'344098383.jpeg'),
(33619,5,E'Креветки жареные в кляре',390,E'Креветки, мука темпурная, вода, яйцо куриное, масло фритюрное (растительное масло), соус терияки. (5 шт.) Кбжу 230/18/11/14. 209 ккал/100 г',110,209,E'344098396.jpeg'),
(33619,5,E'Креветки васаби',570,E'Хрустящая закуска. Креветки темпура в нежном васаби со сгущенкой. Им в унисон — креветочные чипсы. Состав: креветки, кляр, соус васаби сладкий, икра тобико, орех кешью. Кбжу 780/22/59/41. 348 ккал/100 г',225,348,E'344095302.jpeg'),
(33619,5,E'Паста с лососем в сливочном соусе',590,E'Лосось, макароны, сыр пармезан, сливки, базилик. Кбжу 960/35/42/109. 309 ккал/100 г',310,309,E'344095310.jpeg'),
(33619,5,E'Рисовый сендвич с лососем',440,E'Вкусные слои. Под хрустящей коркой чередуются рис, лосось, сливочный сыр, икра. И еще раз в обратном порядке — кусь! состав: лосось, рис, сыр сливочный, салат, огурец, икра, майонез, водоросли нори, икра тобико, темпурный кляр, сухари панко, имбирь маринов. 344 ккал/100 г',255,344,E'342657902.jpeg'),
(33619,6,E'Япо-буррито с лососем (острый)',490,E'Жгучий рисовый рулет. Лосось в связи с острым кимчи и перчиками халапеньо. Состав: рис, водоросли нори, огурец, капуста красная, соус сладкий чили, огурец, салат айсберг, филе лосося, икра тобико оранжевая, сыр сливочный, перец халапеньо, соус спайс. Кбжу 5. 171 ккал/100 г',300,171,E'344135066.jpeg'),
(33619,6,E'Япо-буррито с креветками',490,E'Сладкий рисовый рулет. В центре удовольствия — карамелизованные креветки и сладкий соус чили. А разбавляют сладость листья салата и свежие огурчики. Состав: рис, водоросли нори, салат айсберг, икра тобико оранжевая, сыр сливочный, огурец, креветки, соус чи. 161 ккал/100 г',265,161,E'342681007.jpeg'),
(33619,6,E'Япо-буррито с лососем',490,E'Нежный рисовый рулет. Лосось, маринованная капуста, огурец и сливочный сыр. В каждом укусе так много вкуса! состав: рис, водоросли нори, огурец, капуста красная, соус сладкий чили, филе лосося, икра тобико оранжевая, сыр сливочный, майонез. Кбжу 540/16/23. 186 ккал/100 г',290,186,E'344133002.jpeg'),
(33619,6,E'Япо-буррито с тунцом спайси',490,E'Рулет с огоньком. Тунец кимчи, икра летучей рыбы, огурец и сливочный сыр. Состав: рис, водоросли нори, салат айсберг, икра тобико оранжевый, сыр сливочный, огурец, филе тунца, соус чили сладкий, соус спайси. Кбжу 490/16/16/69. 177 ккал/100 г',275,177,E'344133004.jpeg'),
