(33619,6,E'Япо-тако с креветками',460,E'Морской сэндвич. Всем на сладость — карамелизированные креветки в сладком соусе чили. Состав: рис, креветки, соус сладкий чили, огурец, салат айсберг, сыр сливочный, водоросли нори. Кбжу 270/10/6/43. 137 ккал/100 г',195,137,E'344133006.jpeg'),
