(26878,1,E'Ролл филадельфия с лососем',620,E'Великие роллы. Круговорот нежности лосося, сливочного сыра и авокадо. И, как ни крути, вечная классика — никогда не надоест! состав: рис, лосось, сыр, авокадо, нори, имбирь, васаби. Кбжу 350/22/13/38. 187 ккал/100 г',190,187,E'344162514.jpeg'),
(26878,1,E'Том ям с креветками',520,E'Зарубежная классика. В бульоне с кислинкой и кокосовым молоком креветки, шампиньоны и помидоры. А к нему, по традции, чашка рассыпчатого риса. Состав: креветки, соль, куриный бульон, сахар-песок, масло подсолнечное, лайм, вода, кокосовое молоко, рис, помид. 70 ккал/100 г',430,70,E'342681011.jpeg'),
(26878,1,E'Поке с лососем',620,E'Сочный обед с лососем. Сборная из кусочков рыбы, спелого авокадо, свежих овощей и основы на выбор. Лосось тоже можно выбрать: от классического до самого жгучего. Состав: основа на выбор: рис, киноа или салат. Филе лосося, огурец, кунжут белый жареный, апел. 114 ккал/100 г',205,114,E'343988905.jpeg'),
(26878,1,E'Сет хитовый',2090,E'Всеми любимые роллы вместе. Совершенно разная четверка: с нежным лососем, с икрой тобико, с угрем и в хрустящей темпуре. А вместе — двадцать восемь ролл"н"ролл хитов. Состав: ролл филадельфия с лососем, ролл снежная калифорния, ролл канада, ролл сяке темпу. 178 ккал/100 г',830,178,E'344628012.jpeg'),
(26878,1,E'Рисовый сендвич с лососем',440,E'Вкусные слои. Под хрустящей коркой чередуются рис, лосось, сливочный сыр, икра. И еще раз в обратном порядке — кусь! состав: лосось, рис, сыр сливочный, салат, огурец, икра, майонез, водоросли нори, икра тобико, темпурный кляр, сухари панко, имбирь маринов. 344 ккал/100 г',255,344,E'342651867.jpeg'),
(26878,1,E'Сет лайт',1150,E'Состав: ролл снежная калифорния, ролл креветка спайс, ролл аляска, ролл овара, имбирь маринванный, васаби. Кбжу 1460/53/48/204. 196 ккал/100 г',745,196,E'344628011.jpeg'),
(26878,2,E'Кето завтрак',540,E'Состав: яйцо, микс салата заправленный (шпинат, салат фризе, салат айсберг), заправка для салатного микса (лимон, горчица зернистая, мед, масло оливковое, соль), филе лосося, маринованная красная капуста, огурец, орех кедровый. Кбжу 338/17/25/10. 169 ккал/100 г',200,169,E'343570941.jpeg'),
