(26878,2,E'Собери свой завтрак',160,E'Быстрый завтрак. Свежие яйца со сливками, взбитые и аккуратно поджаренные. Все схвачено! состав: яйцо, сливки 33%, соль, масло подсолнечное. Кбжу: 447/13/42/2. 331 ккал/100 г',135,331,E'343699703.jpeg'),
(26878,2,E'Завтрак с лососем',580,E'Ранняя рыбка. Нежное филе лосося, скрэмбл, салат и хрустящие тосты. Утренний распорядок, конечно, ваш, но мы бы советовали начать с лосося! состав: филе атлантического лосося охлажденное, хлеб харис, яйцо, сливки 33%, соль, масло подсолнечное, шпинат свежи. 189 ккал/100 г',310,189,E'343699704.jpeg'),
(26878,2,E'Английский завтрак',580,E'Много калорий. Охотничья сосиска с лопнувшей корочкой, скрэмбл, салат и тосты. Один из наших самых сытных завтраков. Состав: колбаски охотничьи, яйцо, сливки 33%, соль, масло подсолнечное, хлеб харис, шпинат свежий, руккола, салат айсберг, лук зеленый, баз. 229 ккал/100 г',330,229,E'343699705.jpeg'),
(26878,2,E'Классический завтрак',510,E'Оптимальное начало дня. Глазунья, бекон, слегка поджаренные тосты и хрустящий салат с медом и горчицей. Состав: яйцо, соль, масло подсолнечное, бекон с/к, хлеб харис, шпинат свежий, руккола, салат айсберг, лук зеленый, базилик свежий, сливки 33%, сыр сливо. 186 ккал/100 г',235,186,E'343699706.jpeg'),
(26878,2,E'Утренний сэндвич ролл',260,E'Скрэмбл в лаваше. Помидоры с запеченным беконом, соусом барбекю и майонезом. Вышел сытный крученый! состав: пшеничная лепешка, скрэмбл (яйцо, сливки 33%, масло подсолнечное, соль), помидоры черри, бекон запеченный, майонез, соус барбекю. Кбжу 303/9/20/19. 243 ккал/100 г',125,243,E'343699711.jpeg'),
(26878,2,E'Сэндвич ролл с ветчиной, омлетом и моцареллой',290,E'Три в одном. Ветчина, скрэмбл и сливочная моцарелла закружились к завтраку. Состав: скрэмбл (сливки, масло подсолнечное, яйцо, соль), пшеничная лепешка, ветчина, сыр моцарелла, майонез, соус барбекю. Кбжу 392/18/25/22. 220 ккал/100 г',175,220,E'343699714.jpeg'),
(26878,2,E'Сэндвич ролл филадельфия',390,E'Утренний улов. Свежее филе и салатный лист в соусе "Крем чиз". Под прикрытием румяной пшеничной лепешки. Состав: пшеничная лепешка, филе лосося, салат айсберг, соус крем чиз (лук зеленый, базилик свежий, сливки 33%, сыр творожный, соль). Кбжу 234/10/12/20. 188 ккал/100 г',125,188,E'343699715.jpeg'),
(26878,2,E'Сэндвич ролл цезарь',290,E'Курочка в тесте. Филе, листья айсберга и соус "Цезарь" завернуло в лепешку! состав: пшеничная лепешка, филе куриное, соевый соус, перец черный молотый, салат айсберг, соус цезарь(сыр пармезан, анчоусы филе в масле, чеснок, каперсы консервированные, лайм, м. 208 ккал/100 г',150,208,E'343699719.jpeg'),
(26878,2,E'Гриль чиз сэндвич',260,E'Cырные потянушки. Посреди хлебных ломтиков расплавились моцарелла с чеддером и колбаской пепперони. Такой завтрак можно и растянуть! состав: хлеб тостовый, яичница (яйцо, масло подсолнечное, соль), сыр чеддер, сыр моцарелла, пепперони колбаса, майонез, соу. 258 ккал/100 г',200,258,E'343699720.jpeg'),
(26878,2,E'Сэндвич с яйцом и беконом',260,E'Копченый завтрак. В хрустящем тосте бекон, чеддер, моцарелла и яйцо. Осталось добавить напиток. Состав: хлеб тостовый, яичница (яйцо, масло подсолнечное, соль), сыр чеддер, сыр моцарелла, бекон запеченный, майонез, соус барбекю, петрушка листовая. Кбжу 466. 240 ккал/100 г',195,240,E'343699722.jpeg'),
