(26878,2,E'Рисовая каша с пюре манго на кокосовом молоке',270,E'Наполовину фрукт. Рис взбодрили сочное пюре из манго и кокосовое молоко. Ну и кашу они заварили! состав: кокосовое молоко, вода, рис, соль, сахар, пюре манго. Кбжу 495/5/28/54. 180 ккал/100 г',280,180,E'343699717.jpeg'),
(26878,2,E'Дрип–кофе: перу',99,E'Нужно заваривать. Плотный бархатистый напиток с умеренной кислотностью, понятный каждому. Попробовав его, вы сможете ощутить насыщенный и благородный вкус кофе с оттенками табака и сухофруктов высота – 1400-1500 . Способ обработки - мытая. Степень обжарки.',420,411,E'335906856.jpeg'),
(26878,2,E'Дрип–кофе: бразилия паже',99,E'Нужно заваривать. Кофе позволяющий ощутить себя на плантации в бразилии. Плотный, насыщенный, умеренно кислотный, сбалансированный, с оттенками карамели, шоколада и грецкого ореха сорт катуаи и мундо ново высота – 900-1200 . Способ обработки - натуральная.',10,307,E'335906857.jpeg'),
