(26878,6,E'Поке с тунцом',590,E'Много тунца. Кубики рыбы, апельсин, бобы эдамаме, икра тобико и другие свежие овощи с одним из трех вариантов основы. Тунец тоже на выбор: обычный или поострее. Основа на выбор: рис, киноа или салат. Состав: филе тунца, огурец, апельсин, салат чука, икра т. 87 ккал/100 г',205,87,E'342681076.jpeg'),
