(26878,6,E'Поке ролл',910,E'Плотный обед. Любимые лосось, сливочный сыр, рис и овощи удобно завернуты в нори с соусом поке. Хватит, чтобы вкусно наелись двое. Состав: лосось, водоросли нори, рис, сыр сливочный, огурец, соус спайси, салат айсберг, икра тобико, красная капуста в сладко. 175 ккал/100 г',570,175,E'342681098.jpeg'),
(26878,7,E'Том ям с креветками',520,E'Зарубежная классика. В бульоне с кислинкой и кокосовым молоком креветки, шампиньоны и помидоры. А к нему, по традции, чашка рассыпчатого риса. Состав: креветки, соль, куриный бульон, сахар-песок, масло подсолнечное, лайм, вода, кокосовое молоко, рис, помид. 70 ккал/100 г',430,70,E'342681011.jpeg'),
(26878,7,E'Том ям с лососем',520,E'Лосось с кислинкой. Традиционный суп с кокосовым молоком, шампиньонами и помидорами. Только вместо креветок — много лосося. Состав: лосось, соль, куриный бульон, сахар-песок, масло подсолнечное, лайм, вода, кокосовое молоко, рис, лист лайма, лимонная трава. 72 ккал/100 г',405,72,E'342651837.jpeg'),
(26878,7,E'Том ям с курицей',435,E'Состав: вода, кокосовое молоко, паста том ям, лист лайма, лимонная трава, перец чили, бульон куриный, соль, сахар, масло подсолнечное, кинза, филе грудки, помидоры, грибы шампиньоны, рис, уксус мицукан, водоросли комбу, лимон, апельсин, сахар, соль, лайм. 71 ккал/100 г',430,71,E'343546867.jpeg'),
(26878,7,E'Суп с лососем',350,E'Тройная рыбка. Филе лосося, бульон хондаши и стружка тунца. Три состояния рыб в одной тарелке. Состав: бульон рыбный, лосось, рис, кунжут, водоросли нори, лук зеленый. Кбжу 170/10/3/24. 44 ккал/100 г',375,44,E'344162517.jpeg'),
(26878,8,E'Сэндвич роллы с тунцом и с лососем',590,E'Состав: рис, филе лосося, филе тунца, сыр сливочный, соус спайси, огурец, мука темпурная, сухари панко, масло фритюрное, соус унаги, икра тобико черная, икра тобико оранжевая, лук зеленый, водоросли нори, кунжут белый жареный. Кбжу 760/22/48/60. 291 ккал/100 г',260,291,E'344131456.jpeg'),
(26878,8,E'Два сэндвич ролла с лососем',590,E'Состав: рис, филе лосося, сыр сливочный, соус спайси, огурец, мука темпурная, сухари панко, масло фритюрное, соус унаги, икра тобико оранжевая, лук зеленый, водоросли нори, кунжут белый жареный. Кбжу 800/24/50/65. 307 ккал/100 г',260,307,E'344131466.jpeg'),
(26878,8,E'Креветки васаби',570,E'Хрустящая закуска. Креветки темпура в нежном васаби со сгущенкой. Им в унисон — креветочные чипсы. Состав: креветки, мука темпурная, вода, яйцо куриное, васаби, майонез, соус мирин, креветочные чипсы, орех кешью, икра тобико, молоко сгущенное, масло фритюр. 348 ккал/100 г',225,348,E'341605333.jpeg'),
(26878,8,E'Рисовый сендвич с лососем',440,E'Вкусные слои. Под хрустящей коркой чередуются рис, лосось, сливочный сыр, икра. И еще раз в обратном порядке — кусь! состав: лосось, рис, сыр сливочный, салат, огурец, икра, майонез, водоросли нори, икра тобико, темпурный кляр, сухари панко, имбирь маринов. 344 ккал/100 г',255,344,E'342651867.jpeg'),
(26878,8,E'Наггетсы куриные с картофелем фри (6 шт,)',320,E'Золотая курочка. Обжаренные во фритюре ломтики курицы и картошки с соусом из сливочного сыра с майонезом, зеленью и чесноком. Все готово, осталось придумать напиток. Состав: наггетсы куриные, панировка, картофель фри, соль, масло фритюрное, соус фирменный. 180 ккал/100 г',220,180,E'341605373.jpeg'),
(26878,8,E'Наггетсы куриные с картофелем фри (12 шт,)',570,E'Золотая курочка — порция на двоих. Обжаренные во фритюре ломтики курицы с картошкой. И нежный соус, которого хватит на всех. Состав: наггетсы куриные, панировка, картофель фри, соль, масло фритюрное, соус фирменный (сыр сливочный, майонез, петрушка, соль. 180 ккал/100 г',440,180,E'342651930.jpeg'),
(26878,8,E'Картофель фри',190,E'Гарнир ко всему. Жареные ломтики картошки и нежный соус. Если есть руками, точно пальчики оближешь! состав: картофель фри, соль, соус фирменный (сыр сливочный, майонез, петрушка, соль, чеснок). Кбжу 240/4/12/28. 121 ккал/100 г',195,121,E'344135903.jpeg'),
(26878,9,E'Вок рис с курицей',360,E'Пряная курочка. Нежная грудка с овощами и рисом в сладко-соленом соусе унаги. Состав: рис, куриная грудка, огурец св., Морковь, лук репчатый, перец болгарский красный, масло подсолнечное, соус унаги, соевый соус синг сонг, лук зеленый, кунжут белый жареный. 143 ккал/100 г',355,143,E'342651829.jpeg'),
(26878,9,E'Вок рис с овощами',320,E'Легкий вок. Рассыпчатый рис с шампиньонами и овощами приправлен карамелизованным соусом унаги. Почти соленая карамель! состав: рис, огурец св., Морковь, грибы шампиньоны, лук репчатый, перец болгарский красный, масло подсолнечное, соус унаги, соевый соус с. 132 ккал/100 г',355,132,E'342651835.jpeg'),
(26878,9,E'Вок с рисом и креветками',430,E'Морской вок. Тигровые креветки на одной волне с рисом и свежими овощами. В тему вливаются соево-креветочный соус и унаги. Состав: рис, креветки, огурец, морковь, лук репчатый, перец болгарский красный, масло растительное, соево креветочный соус, лук зелены. 143 ккал/100 г',355,143,E'342651838.jpeg'),
(26878,9,E'Вок с рисом и лососем',430,E'Согревающий микс. Кусочки лосося вперемешку с рассыпчатым рисом и свежими овощами. Их свел вместе соево-креветочный соус. Состав: рис, филе лосося, огурец, морковь, лук репчатый, перец болгарский красный, масло растительное, соево-креветочный соус, лук зел. 142 ккал/100 г',330,142,E'342651846.jpeg'),
(26878,9,E'Гедза с королевской креветкой',460,E'Царь-пельмешки. Сочные внутри, хрустящие снаружи. А креветка задает тон всему блюду. Состав: креветки, вода, мука пшеничная, капуста, вода, соль, картофельный крахмал, сахар, кунжутное масло, черный перец, порошок яичного белка, масло фритюрное, соус чили. 215 ккал/100 г',165,215,E'342407213.jpeg'),
(26878,9,E'Гедза с курицей и овощами',380,E'Хрустящие пельмешки. В тонком тесте сочный фарш из мяса, капусты, лука. И размер — чтобы наестся досыта. Состав: овощи (капуста, лук репчатый, лук душистый, лук-резанец), мука пшеничная, куриное мясо, панировочные сухари, соль, чесночный порошок, соевый со. 166 ккал/100 г',160,166,E'343570943.jpeg'),
(26878,9,E'Паста карбонара',460,E'Сливочный бекон. С ним фузилли аль денте, тертый пармезан и черный молотый перец. Самая известная и нежная паста в мире и у нас. Состав: макароны фузилли, сливки 33%, бекон с/к, яйцо куриное, сыр пармезан, соль, чеснок, орегано сушеное. Кбжу 880/31/36/108. 320 ккал/100 г',275,320,E'344131476.jpeg'),
(26878,9,E'Паста с лососем в сливочном соусе',590,E'Сытные пружинки. Далее по спирали: мясистые кусочки лосося, нежные сливки, бульон хондаши. И на засыпку пармезан. Состав: лосось, макароны, сыр пармезан, сливки, базилик, масло подсолнечное, бульон хондаши. Кбжу 1030/35/50/110. 332 ккал/100 г',310,332,E'344131479.jpeg'),
(26878,9,E'Угорь на рисе',595,E'Угорь превыше всего. Ломтики угря под соусом унаги. Все на горке из рассыпчатого риса. Состав: рис, угорь, соус унаги, кунжут белый жареный. Кбжу 280/10/6/44. 173 ккал/100 г',160,173,E'344131492.jpeg'),
(26878,10,E'Салат с креветками',590,E'Море зелени! в нем бушуют сочные креветки, томаты и руккола. А кедровые орешки с пармезаном поднимают новую волну. Состав: креветки, помидоры, огурец св., Салата руккола, масло подсолнечное, орех кедровый, сыр пармезан, соус-крем бальзамический, чеснок очи. 182 ккал/100 г',170,182,E'344511651.jpeg'),
(26878,10,E'Салат чука с ореховым соусом',295,E'Изумрудная закуска. Немного сладкие и нежные маринованные водоросли. Почти мармелад! состав: салат чука, соус ореховый. Кбжу 180/6/9/19. 104 ккал/100 г',170,104,E'344131462.jpeg'),
(26878,10,E'Салат с карамелизированным баклажаном и креветками',530,E'Сладкий хруст. Креветки вперемешку с листьями салата и баклажанами в апельсиновом соке. Звучит сытно! состав: баклажаны, креветки тигровые, помидоры, соус sweet chili, апельсиновый сок, зелень, кунжут, крахмал, соль, перец. Кбжу 280/14/6/41. 99 ккал/100 г',280,99,E'344162494.jpeg'),
(26878,10,E'Салат из битых огурцов',290,E'Состав: огурцы, чеснок свежий, соус соевый синг сонг, уксус мицукан, кунжутное масло, жареные орехи кешью, кинза свежая, перец чили. Пищевая ценность (средние значения) в 100 г белки - 2,7 г./ Жиры -5,1 г./ Углеводы- 3,5 г. Энергетическая ценность: 70 ккал/ 2. 70 ккал/100 г',235,70,E'344377337.jpeg'),
(26878,10,E'Салат цезарь с курицей',490,E'Любимые сухарики. В сочетании с жареной курочкой, свежими овощами, перепелиными яйцами и нежным соусом. А тертый пармезан подкрепляет любовь к этому салату. Состав: филе куриное, салат айсберг, соус цезарь, гренки, сыр пармезан, помидоры, яйцо перепелиное. 185 ккал/100 г',240,185,E'344131473.jpeg'),
(26878,10,E'Салат цезарь с креветками',590,E'Морская версия. Сочные креветки вперемешку со свежими овощами, сухариками и перепелиными яйцами. Состав: креветки, масло подсолнечное, соль, перец черный молотый, салат айсберг, соус цезарь, гренки, сыр пармезан, помидоры, яйцо перепелиное. Кбжу 440/21/36. 184 ккал/100 г',240,184,E'344162516.jpeg'),
(26878,11,E'3 маленьких пиццы',1090,E'Пицца по твоему индивидуальному вкусу. Выбери три разные пиццы за 999,00 рублей. Состав: мука из твердых сортов пшиницы, мука ржаная, мед, дрожжи сухие, вода, соль, масло оливковое, орегано сушеный, сахар, базилик, томаты очищенные, чеснок сушеный, сыр моц.',750,577,E'341689606.jpeg'),
