(26878,11,E'Пицца мясная',490,E'Тесто, соус томатный, сыр моцарелла, куриная грудка, пепперони, бекон, пармезан, лук красный, масло оливковое, соус фирменный (сыр сливочный, майонез, петрушка листовая, соль, чеснок). Кбжу (25 см) 821/41/42/67, (30 см) 1143/64/52/104.',325,453,E'343527264.jpeg'),
