(26878,11,E'Пицца с курицей и вялеными томатами',440,E'Тесто, соус томатный, сыр моцарелла, вяленые томаты, куриная грудка, перец болгарский, масло оливковое, соус фирменный (сыр сливочный, майонез, петрушка листовая, соль, чеснок). Кбжу (25 см) 648/32/26/71, (30 см) 912/50/31/107.',310,377,E'343527297.jpeg'),
(26878,11,E'Пицца маргарита',390,E'Тесто, сыр моцарелла, соус томатный, масло оливковое, соус фирменный (сыр сливочный, майонез, петрушка листовая, соль, чеснок). Кбжу (25 см) 631/26/27/68, (30 см) 848/36/32/102.',260,381,E'343527307.jpeg'),
