(26878,11,E'Пицца с лососем и сливочным соусом',650,E'Тесто, филе лосося, сыр моцарелла, сливки, соус сливочный, сыр пармезан, руккола, масло оливковое, орегано, соус фирменный (сыр сливочный, майонез, петрушка листовая, соль, чеснок). . Кбжу (25 см) 765/35/38/68, (30 см) 1035/48/48/101.',265,564,E'343527335.jpeg'),
(26878,11,E'Пицца карбонара',480,E'Тесто, сливочный соус, сыр моцарелла, бекон, сыр пармезан, лук красный, масло оливковое, соус фирменный (сыр сливочный, майонез, петрушка листовая, соль, чеснок). Кбжу (25 см) 815/31/45/69, (30 см) 1110/43/58/102.',275,517,E'343527358.jpeg'),
