(26878,11,E'Пицца с креветками',640,E'Тесто, соус томатный, сыр моцарелла, креветки, томаты, сыр сливочный, руккола, масло оливковое, крем бальзамик, соус фирменный (сыр сливочный, майонез, петрушка листовая, соль, чеснок). Кбжу (25 см) 671/30/28/74, кбжу (30 см) 908/42/33/110.',340,524,E'343527364.jpeg'),
(26878,12,E'Япо-тако с креветками',460,E'Морской сэндвич. Всем на сладость — карамелизированные креветки в сладком соусе чили. Состав: рис, креветки, соус сладкий чили, огурец, салат айсберг, сыр сливочный, водоросли нори. Кбжу 270/10/6/43. 137 ккал/100 г',195,137,E'344162415.jpeg'),
(26878,12,E'Япо-тако с лососем (острый)',460,E'Жгучий рисовый сэндвич. Капуста кимчи, халапеньо и спайси-соус. А лосось, огурец и сливочный сыр сглаживают острые углы. Состав: рис, филе лосося, соус кимчи, огурец, масло кунжутное, салат айсберг, соус спайси, перец халапеньо, сыр сливочный, водоросли но. 174 ккал/100 г',200,174,E'342681003.jpeg'),
(26878,12,E'Япо-тако с лососем',460,E'Нежный рисовый сэндвич. Лосось, спелый огурец, сливочный сыр и домашний майонез. Состав: рис, филе лосося, огурец, масло кунжутное, салат айсберг, сыр сливочный, водоросли нори, майонез. Кбжу 360/11/20/34. 191 ккал/100 г',190,191,E'344162490.jpeg'),
