ALTER TABLE restaurants ADD CONSTRAINT pkey_id  PRIMARY KEY(id);


-- -------------------------------CATEGORIES----------------------------------------  


create table categories
(
    id integer UNIQUE NOT NULL,
    name varchar(100) UNIQUE NOT NULL
);



ALTER TABLE categories ALTER COLUMN id SET NOT NULL;
ALTER TABLE categories ALTER COLUMN id ADD GENERATED ALWAYS AS IDENTITY;
ALTER TABLE categories ADD CONSTRAINT categori_pkey PRIMARY KEY(id);

-- -------------------------------CATEGORIES_RESTAURANT-------------------------------------------


create table categori_restaurant
(
    restaurant_id integer REFERENCES restaurants NOT NULL,
    categori_id integer REFERENCES categories NOT NULL
);


-- ----------------------------------COMMENTS-------------------------------
CREATE OR REPLACE FUNCTION get_ru_date(date TIMESTAMP) RETURNS VARCHAR(30) AS $$
DECLARE
    month_str VARCHAR(30);
    BEGIN
        month_str = CASE to_char(date, 'MM') WHEN '01' THEN ' января '
                        WHEN '02' THEN ' февраля '
                        WHEN '03' THEN ' марта '
                        WHEN '04' THEN ' апреля '
                        WHEN '05' THEN ' мая '
                        WHEN '06' THEN ' июня '
                        WHEN '07' THEN ' июля '
                        WHEN '08' THEN ' августа '
                        WHEN '09' THEN ' сентября '
                        WHEN '10' THEN ' октября '
                        WHEN '11' THEN ' ноября '
                        WHEN '12' THEN ' декабря '
                    END;
        RETURN to_char(date, 'DD')|| month_str || to_char(date, 'YYYY, HH24:MI');
    END;
$$ LANGUAGE plpgsql;

create table comments 
(
    author varchar(50) NOT NULL,
    restaurant_id integer REFERENCES restaurants NOT NULL,
    text varchar(1024) NOT NULL,
    stars integer NOT NULL CHECK(1 <= stars and stars <= 5),
    date TIMESTAMP DEFAULT now() NOT NULL
);

