(69660,E'Елизавета Жунда',E'Тухлые помидоры (даже по запаху ощутимо) на пицце 4 сезона, и на ней же - дешманская не то ветчина, не то колбаса со вкусом крахмала и мясных субпродуктов, и сама пицца была уже холодная. Самый бюджетный соевый соус великолепно протек на жалкую пару салфеток и все остальное в пакете. Роллы все несъедобные совершенно, особенно какой-то огуречно-сметанный с укропчиком, отвратительное хрючево, даже невозможно понять, что там должно было быть в начинке. За такие деньги можно все равно найти съедобного уровня такие же блюда в других местах, никогда больше даже не открою меню этого места.',3,E'2022-04-23T18:15:11+0300'),
