(26878,E'Павел',E'Суп том ям с курицей отвратительный, грудка куриная жесткая, переваренная. Роллы ужасные на вкус, за такую цену даже представить было трудно, что привезут такой ужас, сплошной рис и майонез, рыбы не чувствуется вообще! \nВ общем это прям жуткое разочарование и выкинутые деньги. \nНикому не советую!',1,E'2022-04-29T14:41:44+0300'),
