(26878,E'Владислав',E'Очень вкусно, роллы нормального размера. Цены, конечно, кусаются… Но прям вкусно',5,E'2022-04-28T21:36:01+0300'),
(26878,E'Роман Николенко',E'Брал суши с лососем и гункан с тунцом спайси + разные маки: тунец, лосось и огурец. Принесли в двух хороших таких боксах, из топингов бесплатно были приложены белый имбирь и вассаби + соевый соус. Соус в отдельной прямоуголной коробочке, очень удобно. \n\nБлиже к еде.\n\nТопинги супер (что редкость - исбирь и васаби в меру жгучи), соевый соус тоже хорош, не слишком соленый. Дополнительно шли палочки (без долбаных заусенцев, палки не нужно разламывать) и отличные салфетки.  \n\nСуши и гунканы были очень вкусными, а вот маки - ничего особенного, просто норм. Рис везде используют хороший, не разваливается, есть небольшая кислинка.\n\nОбщее качество всех позиций полностью удовлетворило. Буду брать еще. \n\nP.S. Добавьте больше разных суши, господа. Понимаю, что фишка, но все же. Был немного расстроен.',5,E'2022-04-28T21:24:43+0300'),
(26878,E'Алексей Толстых',E'Ребята, это самые вкусные роллы за последнее время! Огромное вам, человеческое спасибо, за такую красоту и качество! Действительно много лосося и вкусно!!!!!😋 Мы в восторге! Теперь, если роллы, то только у вас! Обязательно будем рекомендовать друзьям! 🤗',4,E'2022-04-28T20:57:25+0300'),
(26878,E'Анастасия',E'Рыба свежая и вкусная, но часть роллов по 2 в среднем каждого вида лежали без рыбной начинки, только огурец или остаточки сыра, видимо жопки',3,E'2022-04-28T16:45:54+0300'),
