(26878,E'Екатерина',E'Заказала сасими из лосося. Очень крупно нарезаны куски, из-за которых пришлось запариться с тем, чтобы их уменьшить. Помимо этого направление среза по тканям рыбы неправильное. Также сам соевый соус жидковат, как по мне. Но рыба вкусная, контейнеры удобные. Спасибо, что к рыбке везде положили васаби и имбирь. Но проработайте пожалуйста нарезку. Тогда само блюдо будет вкуснее выглядеть. Ах да, сам лосось был на листочке и с кусочком лимона, как на фото, за что тоже спасибо. Эстетика блюд важна также, как и вкус😊',1,E'2022-04-27T23:02:52+0300'),
