(35905,E'Ольга',E'Рис в тяхане переварен, как каша. В Роллах рис развалился. Картошка фри сразу в мусорку отправилась. Видимо, её уже несколько раз жарили. Курьер опоздал на полтора часа. Ещё и звонил просил ему геопозицию прислать, потому что не понимает, куда ехать',2,E'2022-04-25T01:02:33+0300'),
