(87045,E'Татьяна',E'Пожалуй худшая пицца за последнее время. Полное несоответствие фото, тесто сухое, начинка пересушена. Маргарита по вкусу просто как хлеб с сыром.\nКурица тоже очень сухая и почти без соуса.\nКурьер опоздал на 50 минут, при этом заранее отметил, что заказ доставлен (решали этот вопрос через поддержку деливер. Соответственно, вся еда была холодная, пришлось разогревать. \nНикому данный ресторан не советую. провал по всем пунктам.',1,E'2022-04-24T18:28:40+0300'),
