(58,E'Максим',E'Настоящее разочарование, я в шоке. Острое не острое, кисло-сладкое - не кислое и не сладкое. Все какого-то одинакового горького вкуса. Огромные куски порченых, черных внутри бананов, карамель покрывает плохо и ее мало. Баклажаны или свинина - на вкус непонятно вообще что это. Говядину еще можно есть (если прожуешь), остальное проще выкинуть. Худшее исполнение китайской кухни, которое я видел.',3,E'2022-03-13T19:34:02+0300'),
