(85747,E'Елена',E'Курьер самого ресторана задержался на 40 минут!!!\nЭто немыслимо с учетом того, что до моего адреса оттуда на общественном транспорте ехать максимум 10 минут..\nОт ресторана никто не связывается после сообщения о опоздании…\nУ курьера нет термосумки и еда приехала холодной…\nЗаказываю первый раз и очень расстроена',1,E'2022-04-22T21:27:19+0300'),
(85747,E'Леонид',E'Очень невкусная еда',1,E'2022-04-14T19:20:49+0300'),
(85747,E'Лина',E'Ранее сильно нравилась эта доставка. Еда была намного вкуснее. Заказывала неоднократно и каждый раз качество еды заметно ухудшается. Мои любимые вафли теперь уже так не радуют. Стали жалеть начинку, сами вафли очень сухие, не хватает соуса. Буррито просто не понравилось, почему-то было очень кислое и прям много горького лука. Хинкали слишком перченые, помимо перца другого вкуса не чувствуешь вообще. Такое ощущение что мясо испортилось и его специально так заперчили. Бургер вообще никакой. В общем неприятно :(',1,E'2022-04-13T16:34:37+0300'),
(85747,E'Андрей',E'Доставка очень длительная, вся еда холодная. В  вафлях очень мало начинки. Вместо колбаски гриль - два кусочка сырокопченой колбасы. Пожалели даже банан, настолько тонко он нарезан, что просвечивается.',3,E'2022-03-27T16:35:11+0300'),
(85747,E'Дарья',E'Блюдо мксимально не соответствует фото в приложении. Цены неоправданно завышены. 500+ рублей за бургер, который хуже и меньше Биг Мака - это слишком. Буритто - обычная шаверма за 390р. Вафли - за 300+ рублей вместо свежей клубники, лениво намазали клубничное варенье на сухую вафлю. Больше тут заказывать никогда не будем и никому не советуем. А ресторану лучше бы сменить фото в приложении, чтобы не обманывать своих клиентов',3,E'2022-03-27T05:10:29+0300'),
(85747,E'Изотова Алена Сергеевна',E'Заказали на пробу все. И вафли, и бургеры и пиццу. Еда абсолютно несъедобная. Все понадкусали и выбросили. В чикен бургере какой то непонятный оранжевый соус, абсолютно не сочетается. Качество продуктов оставляет желать лучшего',1,E'2022-03-26T11:44:07+0300'),
(85747,E'Кирилл Осипов',E'Заказ доставили не полный, забыли бургер. Из всего заказа только хинкали съедобны. Цены явно завешены и не стоят этого. Не советую, сам больше никогда заказывать в данном месте не буду.',3,E'2022-03-22T16:16:46+0300'),
(85747,E'Юра',E'на счёт правильно собран, перепутали сэндвич с рыбой и колбасой больше так делать не стоит, аллергия на рыбу все\n расставила на места',4,E'2022-03-17T04:44:53+0300'),
(85747,E'Алена Иванова',E'Одну кока колу не довезли!',3,E'2022-03-16T14:40:43+0300'),
(85747,E'Владимир',E'Блюда были хорошие\nНо курьер- ужасен.\nОпоздал, оскорблял, матерился\n\nБольше в этой компании заказывать не буду',3,E'2022-03-16T11:01:28+0300'),
(85747,E'Семен',E'Буррито был очень вкусным, пицца и бургер так себе. вафли тоже ничего',4,E'2022-03-16T10:58:17+0300'),
(85747,E'Димас',E'Обещали за 80 минут. Приехало почти через 2 часа. Уверен- было бы вкуснее, если приехало на пол часа раньше. Плюс вместо одного куриного бургера приехал говяжий. Вафля вкусная.',1,E'2022-03-13T20:58:16+0300'),
(85747,E'Лина',E'Не смотря на то, что заказ ждали достаточно долго (1,45 минут) еда приехала горячей. Расстроило то, что вместо заказанных вафлей привезли вафли с другой начинкой, есть разница в цене и это не приятно, но! Вкус еды компенсировал все эти недочеты. Серьезно, я даже не ожидала, что будет так чертовски вкусно. Ещё порции достаточно большие и сытные. Определенно буду заказывать ещё.',5,E'2022-03-12T21:40:04+0300'),
(10188,E'Анастасия',E'Заявляют доставку в течение 2х часов, а вок и тёплые роллы не удосужились завернуть в фольгу, приехала всё остывшее, макароны слиплись. \nЗаказала тёплые роллы с ЛОСОСЕМ, приехали с СЕЛЕДКОЙ!!!',3,E'2022-04-29T18:18:23+0300'),
(10188,E'Алена',E'Все вкусно кроме токпокки!\nЯ заказывала токпокки с овощами, а не овощи с токпокки))) капусты СЛИШКОМ много, курица просто вареная и сухая. В общем, именно это блюдо полная лажа',3,E'2022-04-27T23:33:17+0300'),
(10188,E'Вадим',E'Один из лучших ресторанов корейской кухни. Кимчи так вообще запредельно вкусное)',4,E'2022-04-18T17:20:39+0300'),
(10188,E'Ася',E'К кухне нет претензий!А вот к курьеру их множество!Пожалуйста, объясните ему,что когда передал заказ, нужно попрощаться и уехать!А не бежать следом с кучай вопросов "что?как? по чем?".Ситуация возникла ужасная!!!Я на работе, забираю у него заказ,он ж.е идёт за мной с данными вопросами.Я попросила его подняться,что я открою ему дверь,но он продолжал дальше идти за мной и задавать кучу вопросов!!!При чем ответ "мне сейчас не удобно!",его совершенно не остановил и он продолжал в своём духе,не слыша что ему говорят!!!К сожалению пришлось прибегнуть к грубому тону,на что он ещё возмущаться начал!Примите меры,пожалуйста!',1,E'2022-04-17T20:40:47+0300'),
(10188,E'Нина',E'Не понравились пегодя! Тесто ооооочень блеклое! Паровое тесто должно быть воздушным! И начинка оставляет желать лучшего ! Мясо- жилы!  Ооооочень понравилось кукси! Просто знаю настоящий вкус! Ели в Узбекистане в корейских кафе! И в курице очень много уксуса! А в целом неплохо! Конечно выиграло кукси! Желаю быть совершенными!',2,E'2022-04-07T10:51:40+0300'),
(10188,E'Наталия',E'Привезли заказ раньше срока, с этим проблем не было. Но кимчи тиге не закрыли нормально и весь пакет был в супе! Очень неприятно, заказывали там не в первый раз..',1,E'2022-04-06T17:45:41+0300'),
