(10188,E'Мария',E'Отвратительная еда, заказали много разных блюд из всего самым нормальным был сет с курицей и все… кимчи пахли тухлятиной, супы ни о чем, пибимбап тоже сухой, булочки были заветренные, а в токпоках их было всего несколько штук и голимые овощи. Если хотите испортить себе вечер и ужин, заказывайте здесь, а всем остальным советую пройти мимо и заказать нормальную еду и не тратить время (на минуточку заказ ждать 2 часа) и деньги (цены завышены). По итогу почти ничего не было съедено…',2,E'2022-03-16T21:30:08+0300'),
