(27788,E'Саша',E'С учётом того, что заказ был заказан заранее на утро и никаких пробок не было (2 балла) ваше опаздывание на 20 минут - это наплевательское отношение к клиентам.\nИ у вас так постоянно.',3,E'2022-04-29T07:11:56+0300'),
