(27788,E'Николай',E'Теперь я понимаю, почему у ресторана оценка 3.9. Бургеры,на картинке это одно, в реальности совсем другое, своих денег не стоят. Роллы отвратительного качества, все разваливаются и неприятно пахнут. Позвонил в ресторан,по этому вопросу, снял для них видео с роллами ,они признали ненадлежащее качество, но заказ отменять не стали, и возвращать деньги тоже. Пицца в школьной столовой лучше!',2,E'2022-04-27T16:21:23+0300'),
