(27788,E'Татьяна',E'Ресторан доставлял еду больше 3х часов, находится в 15 минутах ходьбы от дома.\nНе позвонили, не предупредили и даже не отвечали на звонки оператора.\n\В деливери заказ отображался как «доставлен», хотя по факту еда не приехала.\nЕда пришла ледяная \nПодход ресторана к работе отвратительный',2,E'2022-04-24T01:49:57+0300'),
