(70529,E'Михаил',E'Добрый день \nРаньше это была самая вкусная шаурма, с приходом нового повара, она ухудшилась процентов на 70. \n\nПорции маленькие, перевес в стороны капусты( для веса ) курица холодная. Соуса как всегда с гулькин нос\n\nПо заказу, в пите ещё можно было есть, но без энтузиазма\n\nШаурму в лаваше просто выкинули, она абсолютно сухая, начинки там нет \nЯ бы назвал ее капуста в лаваше.\n\n\nУважаемые руководители данной точки, я бы присмотрелся к смене повара, раньше у вас очереди были, у вас была самая вкусная шаурма. Сейчас из-за постоянных недовесов, увеличения размера капустой, вы теряете своих клиентов. \n\nЯ написал в комментарии к заказу, что я знаю все граммовки и прочее. Но и это не испугало этого горе повара.\nЯ и лично пытался с ним разговаривать, но у нас произошёл конфликт. В котором он просто вынул деньги из кассы и вернул мне их ( хотя я оплачивал картой, вот так привет налоговой )\n\nВообщем одумайтесь, и проведите с ним беседу или контролируйте его!\nА то Скоро из гостей никого не останется',2,E'2022-02-08T09:03:39+0300'),
