CREATE TABLE statuses (
    name VARCHAR(30) NOT NULL,
    id integer GENERATED ALWAYS AS IDENTITY
); 


CREATE OR REPLACE FUNCTION get_order_status(status_dates TIMESTAMP[4]) RETURNS VARCHAR(30) AS $$
DECLARE
    now TIMESTAMP;
    status VARCHAR(30);
    BEGIN
        now := now();
        FOR i IN 1..3
        LOOP
        RAISE NOTICE '%', now ;
        RAISE NOTICE '%', status_dates[i] ;
        IF now < status_dates[i] THEN
            SELECT name INTO status FROM statuses WHERE id=i;
            RETURN status; 
        END IF;
        END LOOP;
            SELECT name INTO status FROM statuses WHERE id=4;
            RETURN status; 
    END;
$$ LANGUAGE plpgsql;

CREATE VIEW orders AS
    SELECT o.id id, o.address address, o.user_id user_id, to_char(o.date, 'DD.MM.YYYY') date, o.date  fulldate,get_order_status(statuses) status, r.name restaurant_name, r.slug restaurant_slug, o.total_price total_price, o.cart
    FROM orders_internal o JOIN restaurants r ON o.restaurant_id=r.id;
